import './App.css';
import React from 'react'
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'
import HeaderComponent from './components/HeaderComponent';
import ListUserComponent from './components/ListUserComponent';
import CreateUserComponent from './components/CreateUserComponent';

function App() {
  return (
    <div className="App">
      <Router>
        <HeaderComponent/>
        <div className='container'>
          <Routes>
            <Route path='/' exact element={<ListUserComponent/>}></Route>
            <Route path='/users' element={<ListUserComponent/>}></Route>
            <Route path='/add-user/:id' element={<CreateUserComponent/>}></Route>
            <Route path='/view-user/:id' element={<ViewUserComponent/>}></Route>
            <Route path='/update-user/:id' elemnet={<UpdateUserComponent/>}></Route>
          </Routes>

        </div>
      </Router>
    </div>
  );
}

export default App;
